syntax = "proto2";

package earth.logging;

option java_multiple_files = true;
option optimize_for = CODE_SIZE;
option java_package = "com.google.android.apps.earth.logging";

message DeeplinkLog {
    optional string path = 1;
    optional string utm_source = 2;
    optional string utm_campaign = 3;
    optional string utm_term = 4;
}
